import React, { useState } from 'react';


const App =() =>{
    
    
   const [count , newCount] = useState();
   const IncNu =(e)=>{
    newCount(e.target.value)
   }
    
   const IncNum = () =>{
    newCount(count+1);
   }
   return(
    <>
        <input type='text' defaultValue={count} onChange={IncNu} />
        <button onClick={IncNum}>Click Me</button>
    </>
   )
}

export default App;
